    return (
      <div style={style.bucket.bucketBorder}>
        <h3 className="text-foot w-300">รายการสินค้า</h3>
        <hr />
        <ul>
          <li></li>
          <li></li>
        </ul>
        <hr />
        <button>ยืนยัน</button>
        <button>ยกเลิก</button>
      </div>
    );
  }
}
